					"html": "<P>Calli Dollinger is a singer/songwriter and multi-instrumentalist living in San Francisco by way of Texas. Time Out Chicago describes her unique vocal style as \"the back room ghost of a classic rock chanteuse\", and her influences are based in evolving folk, rock, and R&B styles that span the decades.  Raised by a music-loving former Texas beauty queen in Austin, Texas, Calli was exposed to a long list of musical matriarchs such as Janis Joplin, Joni Mitchell, Patti Smith, Debbie Harry, Aretha Franklin, Lucinda Williams, Tori Amos, and Madonna, at a very young age.  Also extremely influential were the film scores of Henry Mancini, Bernard Herrmann, and Elmer Berstein's \"To Kill A Mockingbird\".  Having played with various bands, including Columbia Records' Wild Belle, Calli is currently developing her solo career and material that finds itself somewhere between Pop, Soul, and Psychedelic Rock.  </P>",
