					"html": "<P><SPAN>The happiest hour in Downtown LA with live music by the talented Rod Castro every Friday! <BR> <BR> Rod is a Los Angeles-based session guitarist. Rod was the guitarist and music writer for Day 8, fronted by actor Tom Sizemore, and worked with members of Roadrunner recording group Soulfly and Geffen recording group Snot. Rod has written and recorded music for shows including X-Factor, America's Got Talent, Gene Simmons Family Jewels and The Two Coreys, LA Ink, 90210 and A&E's documentary \"Finding Hulk Hogan\".<BR> <BR> Rod currently plays guitar for SuperNaked and composes music for The Bleeding Fingers Custom Music Shop (A Hans Zimmer &amp; Extreme Music Partnership).<BR> <BR> No Cover | 21+</SPAN></P>",
					"text": "The happiest hour in Downtown LA with live music by the talented Rod Castro every Friday!     Rod is a Los Angeles-based session guitarist. Rod was the guitarist and music writer for Day 8, fronted by actor Tom Sizemore, and worked with members of Roadrunner recording group Soulfly and Geffen recording group Snot. Rod has written and recorded music for shows including X-Factor, America's Got Talent, Gene Simmons Family Jewels and The Two Coreys, LA Ink, 90210 and A&E's documentary \"Finding Hulk Hogan\".    Rod currently plays guitar for SuperNaked and composes music for The Bleeding Fingers Custom Music Shop (A Hans Zimmer & Extreme Music Partnership).    No Cover | 21+ "
