				"description": {
					"html": "<P>This holiday season <B>San José - Dublin Sister City Program</B> offers the return of <B>Winterdance, The Show</B>, presented <B>for the third year at Trinity Cathedral</B>, 81 North 2nd Street, Downtown San Jose on <B>Friday, December 19th, 7:00 PM!</B></P>\r\n<P><B><EM>Molly's Revenge</EM></B>, starring <B>David Brewer</B>, <B>John Weed</B> and <B>Stu Mason</B> stunning vocalist <B>Christa Burch</B> of the Syncopaths, and the award winning <B>Rosemary Turco Irish Dancers</B>and special guests <STRONG>Charmas</STRONG>, will present an evening of music, song and dance associated with the festive season. The performance will include Christmas songs both old and new, all played with a Celtic twist, and something new for our regulars.</P>\r\n<P><B><EM>Molly's Revenge</EM></B>, whose lineup includes bagpipes, fiddle, whistle, guitar, mandola, and bodhran, have toured extensively in the USA as well as Australia, China and Scotland. The band is known for its unique and infectious on-stage enthusiasm. Their arrangements of traditional jigs and reels bring these dance tunes up to date with a driving, hard-edged accent that always leaves audiences shouting for more.</P>\r\n<P>New this year at the Trinity Cathedral show will be an opening set from the Celtic combo <B>Charmas Trio</B>, featuring <B>Richard Dwyer</B>, vocals, low whistle and bodhran, <B>Aaron Clegg</B>, vocals, Celtic wooden flute, <B>Jim Powell</B>, backup vocals and guitar.</P>\r\n<P>Guest vocalist Christa Burch possesses a singular voice: warm, supple, expressive, intimate, and instantly recognizable. Part of a vibrant new generation of American folk singers, Christa deftly marries intuitive musicianship and storytelling through song. To balance the gentle beauty of Christa's songs, the Turco Irish dancers will bring a percussive, joyful, and colorful exuberance to the stage.</P>\r\n<P>California-based Molly's Revenge has toured since 2000 as a four and five-piece acoustic band, releasing eleven CDs along the way. Just last year, Molly's Revenge and Christa Burch recorded a collection of Celtic Christmas and winter-themed music at a remote windswept retreat in the redwoods of the Mendocino coast. This beautiful holiday album will be available at the shows.</P>\r\n<P>As always, this 10th Annual Celtic Christmas Celebration will capture the traditional spirit of the season and warm the hearts of all who attend.</P>\r\n<P>Full details at <A HREF=\"http://www.mollysrevenge.com/shows.shtml\" TARGET=\"_blank\" REL=\"nofollow\">www.mollysrevenge.com/shows.shtml</A>, or check the Cathedral website at <A HREF=\"http://www.trinitysj.org\" TARGET=\"_blank\" REL=\"nofollow\">www.trinitysj.org</A> or call at (408) 293-7953. The performance is made possible in part by the <B>Harold R. Hayes fund</B> and the proceeds benefit our <B>Pat McMahon Scholarship Programs</B>.</P>\r\n<P>Artist sites and sounds:<BR> Molly's Revenge<BR> <A HREF=\"http://www.mollysrevenge.com\" TARGET=\"_blank\" REL=\"nofollow\">www.mollysrevenge.com</A> <BR> <BR> Christa Burch<BR> <A HREF=\"http://www.christaburch.com\" TARGET=\"_blank\" REL=\"nofollow\">www.christaburch.com</A> <BR> <BR> Charmas<BR> <A HREF=\"http://charmasband.com\" REL=\"nofollow\">http://charmasband.com</A></P>",
					"text": "This holiday season San José - Dublin Sister City Program offers the return of Winterdance, The Show, presented for the third year at Trinity Cathedral, 81 North 2nd Street, Downtown San Jose on Friday, December 19th, 7:00 PM! \nMolly's Revenge, starring David Brewer, John Weed and Stu Mason stunning vocalist Christa Burch of the Syncopaths, and the award winning Rosemary Turco Irish Dancersand special guests Charmas, will present an evening of music, song and dance associated with the festive season. The performance will include Christmas songs both old and new, all played with a Celtic twist, and something new for our regulars. \nMolly's Revenge, whose lineup includes bagpipes, fiddle, whistle, guitar, mandola, and bodhran, have toured extensively in the USA as well as Australia, China and Scotland. The band is known for its unique and infectious on-stage enthusiasm. Their arrangements of traditional jigs and reels bring these dance tunes up to date with a driving, hard-edged accent that always leaves audiences shouting for more. \nNew this year at the Trinity Cathedral show will be an opening set from the Celtic combo Charmas Trio, featuring Richard Dwyer, vocals, low whistle and bodhran, Aaron Clegg, vocals, Celtic wooden flute, Jim Powell, backup vocals and guitar. \nGuest vocalist Christa Burch possesses a singular voice: warm, supple, expressive, intimate, and instantly recognizable. Part of a vibrant new generation of American folk singers, Christa deftly marries intuitive musicianship and storytelling through song. To balance the gentle beauty of Christa's songs, the Turco Irish dancers will bring a percussive, joyful, and colorful exuberance to the stage. \nCalifornia-based Molly's Revenge has toured since 2000 as a four and five-piece acoustic band, releasing eleven CDs along the way. Just last year, Molly's Revenge and Christa Burch recorded a collection of Celtic Christmas and winter-themed music at a remote windswept retreat in the redwoods of the Mendocino coast. This beautiful holiday album will be available at the shows. \nAs always, this 10th Annual Celtic Christmas Celebration will capture the traditional spirit of the season and warm the hearts of all who attend. \nFull details at www.mollysrevenge.com/shows.shtml, or check the Cathedral website at www.trinitysj.org or call at (408) 293-7953. The performance is made possible in part by the Harold R. Hayes fund and the proceeds benefit our Pat McMahon Scholarship Programs. \nArtist sites and sounds:  Molly's Revenge  www.mollysrevenge.com     Christa Burch  www.christaburch.com     Charmas  http://charmasband.com "
				},
