					"html": "<P>FIGat7th Holiday Sessions</P>\n<P> </P>\n<P>What:<SPAN>                </SPAN>Contemporary Los Angeles musicians perform originals and a few surprise holiday covers <SPAN>during Holiday Sessions at FIGat7th.</SPAN></P>\n<P> </P>\n<P>When:<SPAN>                </SPAN>Fridays, December 4, 11,18, 2015<SPAN> (lineup below)</SPAN></P>\n<P><SPAN>7:30 p.m. – 9:00 p.m.</SPAN></P>\n<P><SPAN> </SPAN></P>\n<P>Dec 4   | Mark de Clive-Lowe &amp; Friends</P>\n<P>Dec 11 | San Miguel Perez &amp; The New Cuban Sound</P>\n<P>Dec 18 | Nia Andrews</P>\n<P><SPAN> </SPAN></P>\n<P>Where:<SPAN>              </SPAN>FIGat7th (TASTE Food Hall Courtyard)</P>\n<P><SPAN>                           </SPAN><SPAN>735 S. Figueroa Street</SPAN><SPAN>, <SPAN>Los Angeles, CA 90017</SPAN></SPAN></P>\n<P> </P>\n<P>Presenter:<SPAN>        </SPAN>Arts Brookfield</P>\n<P> </P>\n<P>Website:<SPAN>            </SPAN>www.ArtsBrookfield.com/HolidaySessions</P>\n<P> </P>\n<P>Cost:<SPAN>              </SPAN>   FREE <SPAN>($5 Flat Rate Parking all night after 4pm)</SPAN></P>\n<P><SPAN></SPAN></P>\n<P>DECEMBER 11th – SAN MIGUEL PEREZ &amp; THE NEW CUBAN SOUND</P>\n<P>Born in Granma, Cuba, San Miguel is a young talented musician known as \"El Tresero Moderno\" (The Modern Tresero). Considered one of the best Cuban tres and guitar players, he is also a singer, percussionist and composer, and highly respected for his knowledge of the true identity of Cuban Music. San Miguel has been awarded with the Cubadisco 2011 for Best Tresero, and in 2014 for Best Música Tradicional Cubana. In Cuba, he was part of the great band of Adalberto Alvarez y Su Son, Jóvenes Clásicos del Son, Soneros de Verdad and The New Generation of the famous Buena Vista Social Club. San Miguel also recorded the acclaimed Latin Grammy nominated album <I>100 Sones</I> of Edesio Alejandro. He now resides in Los Angeles where he has been writing, playing and recording with Peruvian born singer-producer Cecilia Noël, and with Grammy award winning artist Colin Hay (Men at Work). He is in the final stages of the recording of his upcoming album <I>Un Poquito de Amor Everyday</I>, to be released this fall.</P>",
					"text": "FIGat7th Holiday Sessions \n  \nWhat:                Contemporary Los Angeles musicians perform originals and a few surprise holiday covers during Holiday Sessions at FIGat7th. \n  \nWhen:                Fridays, December 4, 11,18, 2015 (lineup below) \n7:30 p.m. – 9:00 p.m. \n  \nDec 4   | Mark de Clive-Lowe & Friends \nDec 11 | San Miguel Perez & The New Cuban Sound \nDec 18 | Nia Andrews \n  \nWhere:              FIGat7th (TASTE Food Hall Courtyard) \n                           735 S. Figueroa Street, Los Angeles, CA 90017 \n  \nPresenter:        Arts Brookfield \n  \nWebsite:            www.ArtsBrookfield.com/HolidaySessions \n  \nCost:                 FREE ($5 Flat Rate Parking all night after 4pm) \n \nDECEMBER 11th – SAN MIGUEL PEREZ & THE NEW CUBAN SOUND \nBorn in Granma, Cuba, San Miguel is a young talented musician known as \"El Tresero Moderno\" (The Modern Tresero). Considered one of the best Cuban tres and guitar players, he is also a singer, percussionist and composer, and highly respected for his knowledge of the true identity of Cuban Music. San Miguel has been awarded with the Cubadisco 2011 for Best Tresero, and in 2014 for Best Música Tradicional Cubana. In Cuba, he was part of the great band of Adalberto Alvarez y Su Son, Jóvenes Clásicos del Son, Soneros de Verdad and The New Generation of the famous Buena Vista Social Club. San Miguel also recorded the acclaimed Latin Grammy nominated album 100 Sones of Edesio Alejandro. He now resides in Los Angeles where he has been writing, playing and recording with Peruvian born singer-producer Cecilia Noël, and with Grammy award winning artist Colin Hay (Men at Work). He is in the final stages of the recording of his upcoming album Un Poquito de Amor Everyday, to be released this fall. "
